import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      {/* Encabezado */}
      <header className="App-header">
        <div className="logo">fondos.com</div>
        <div className="spacer"></div>
        <div className="navItem">Registrarse</div>
        <div className="navItem">Ayuda</div>
        <div className="navItem">Nombre Función</div>
      </header>

      {/* Barra de Navegación */}
      <nav className="navbar">
        <div className="navItem">Función 1</div>
        <div className="navItem">Función 2</div>
        <div className="navItem">Función 3</div>
      </nav>

      {/* Hero */}
      <section className="hero">
        <h1>Bienvenidos a Fondos.com</h1>
        <p>Tu sitio de información y servicios financieros</p>
      </section>

      {/* Secciones */}
      <section className="section">
        <h2>Nav 1</h2>
        <p>Contenido para la primera sección de navegación.</p>
      </section>

      <section className="section">
        <h2>Nav 2</h2>
        <p>Contenido para la segunda sección de navegación.</p>
      </section>
    </div>
  );
}

export default App;
